import React from "react";
import styled from "styled-components";

const HeaderDivStyle = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
  align-items: center;
  min-height: 60px;
`;

const SidebarHeader = () => {
  return <HeaderDivStyle />;
};

export default SidebarHeader;
